values:
sigh. we're back to square one. all those driving days are so over. it's so freaking quiet around here. they being back doesnt really make much of a difference. its still as if they're gone. urgh.&nbsp;

on a lighter note. teachers gave us a holiday pressie :) we have today's and tml's lecture off =D hence the reason i'm here banging away happily at my keyboard. dont have to be in school till one for database test which is kinna crap cuz we usually have our tests on monday. haha else i might not even have to go school today. whee~ ohwell. better than nothing i guess. just that it's kinna a waste for my travelling fees. lol. decided to go for MOL tml. 7.20 show i think. whee. i've always loved to watch magic shows. =D used to watch david copperfield in the past. i think i still have one of his vcds somewhere. always fancinated by what i see. but dont wanna really learn cuz that would spoil the wonder of it. ;)&nbsp;

be meeting up with pearlene and benson this sunday -yay- town&nbsp;here we come&nbsp;xD i'm hungry. shall hunt for some food before i head to school. -waves goodbye-
